     # Checks the position of the robot and depending on which position 
     # the robot is procced to the relevant movements
     def check_position(self):
        if (self.position_status.get()) == "Sitting":
            self.posture.goToPosture("Stand", 0.8)
            self.position_status.set("Standing")
        elif(self.position_status.get()) == "Standing":
            pass
     
     
     # Changes the tone of the speech of the robot by changing the value of the VCT
     def magic_potion(self):
         self.tts.say("I have noticed when I drink this magic potion my voice changes a bit. I will so you what I mean")
         time.sleep(2)
         self.tts.say(" \VCT=60\  This magic potion makes my voice sound like I am from an other planet.A very strange voice that to be honest sometimes I like it.")
         self.tts.say(" \VCT=100\ But the good thing is that after five seconds everything comes back to normal")
     
    
